import Navbar from './components/navbar/Navbar';
import Header from './components/header/Header';
import CardsPrin from './components/cardsPrin/Card';
import Footer from './components/footer/Footer';

function App() {
  return (
    <div className="App">
        <Navbar/>
      <Header/>
      <CardsPrin/>
      <Footer/>
    </div>
  );
}

export default App;
